// //企业年度综合能耗指标
import request from '@/utils/request'; // 查询列表

export function getDTOs(query) {
  return request({
    url: '/ems/yearIndicatorsSynthesisEnergy',
    method: 'get',
    params: query
  });
} // 创建

export function postDTO(data) {
  return request({
    url: '/ems/yearIndicatorsSynthesisEnergy',
    method: 'post',
    data: data
  });
} // 查询单个

export function getDTO(rowId) {
  return request({
    url: "/ems/yearIndicatorsSynthesisEnergy/".concat(rowId),
    method: 'get'
  });
} // 更新

export function patchDTO(rowId, data) {
  return request({
    url: "/ems/yearIndicatorsSynthesisEnergy/".concat(rowId),
    method: 'patch',
    data: data
  });
} // 删除

export function deleteDTO(data) {
  return request({
    url: "/ems/yearIndicatorsSynthesisEnergy",
    method: 'delete',
    data: data
  });
} // 查询

export function queryUnits(workCenterLevel) {
  var query = {
    workCenterLevel: workCenterLevel
  };
  return request({
    url: "/ems/indicatorsSynthesisEnergy/Units",
    method: 'get',
    params: query
  });
}
